import { React } from "react";
import { createRoot } from "react-dom/client";
import Homepage from "./PageComponents/Homepage";
import Footer from "./PageComponents/Footer";
import Nav from "./PageComponents/Nav";

import styled from "styled-components";
import {
  BrowserRouter as Router,
  Route,
  Link,
  Routes,
  Navigate,
} from "react-router-dom";

const StyledLink = styled(Link)`
  text-decoration: none;
`;

const settings = {};

// Async function to fetch data from settings
const fetchSettings = async (settings) => {
  const response = await fetch("http://localhost:3002/api/v1/settings");
  const data = await response.json();
  //return data;

  //console.log(data);
  settings = data;
  return settings;
};

//const data = fetchSettings();
console.log(await fetchSettings(settings));

const container = document.getElementById("root");
const root = createRoot(container);

root.render(
  <Router>
    <Nav />

    <Routes>
      <Route exact path="/" element={<Homepage />} />

      <Route path="*" element={<Navigate from="*" to="/" />} />
    </Routes>

    <Footer />
  </Router>
);
